import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { CSSTransition, TransitionGroup } from "react-transition-group";
import Home from "./components/Home";
import About from "./components/About";
import Projects from "./components/Projects";
import Layout from "./components/Layout"; // Assuming this is used as a wrapper for your pages

const App = () => {
  return (
    <Router>
      <Layout>
        <TransitionGroup>
          <Routes>
            <Route
              path="/"
              element={
                <CSSTransition
                  timeout={500}
                  classNames="page"
                  unmountOnExit
                >
                  <Home />
                </CSSTransition>
              }
            />
            <Route
              path="/about"
              element={
                <CSSTransition
                  timeout={500}
                  classNames="page"
                  unmountOnExit
                >
                  <About />
                </CSSTransition>
              }
            />
            <Route
              path="/projects"
              element={
                <CSSTransition
                  timeout={500}
                  classNames="page"
                  unmountOnExit
                >
                  <Projects />
                </CSSTransition>
              }
            />
          </Routes>
        </TransitionGroup>
      </Layout>
    </Router>
  );
};

export default App;
